use Google\Cloud\Bigtable\BigtableClient;
use Google\Cloud\Bigtable\Mutations;

/**
 * Create an empty row
 *
 * @param string $projectId The Google Cloud project ID
 * @param string $instanceId The ID of the Bigtable instance
 * @param string $tableId The ID of the table in which to create the empty row
 */
function create_empty_row(
    string $projectId,
    string $instanceId,
    string $tableId
): void {
    // Connect to an existing table with an existing instance.
    $dataClient = new BigtableClient([
        'projectId' = $projectId,
    ]);
    $table = $dataClient-table($instanceId, $tableId);

    $columnFamilyId = 'stats_summary';

    $timestampMicros = time() * 1000 * 1000;
    $mutations = (new Mutations())-upsert($columnFamilyId, 'connected_wifi', 0, $timestampMicros);

    $table-mutateRow('tablet#a0b81f74#20190501', $mutations);

    printf('Successfully created a new row' . PHP_EOL);
}

